        <rect stroke="black" stroke-width="1.0" x="42.0" y="89.691" width="54.0" height="534.995" fill="red" opacity="0.2">
         <title stroke="black" stroke-width="1.0">BODYCOLUMN: 0/Structured // Commanding // Store data and // computing // instructions in a // sequence of memory // locations, then // follow the sequence // of instructions (may // include conditions // and loops) and load, // manipulate, or save // data accordingly to // get solutions. // // // // Functional Form // Filling // Define the names of all // wildcards (that can // be replaced by // anything), the // content of all forms, // and the inputs to // replace the // wildcards. Execution // replaces wildcards in // forms by filling in // specified input in the // given order. // Ontological // Dictionary Defining // A special variant of // form filling, where // the entries of an // ontology are // wildcards, and their // definitions are // forms, possibly using // other wildcards. // Computing is // defined as replacing // all wildcards to get a // fully explicit // definition for a // dictionary entry. // // // // // // // // // Logical Solution // Isolating // Declare the input of all // potential solutions, // then apply all // relevant constraints // to distinguish actual // solutions from // nonsolutions. // // // // // // // </title>
        </rect>
        <rect stroke="black" stroke-width="1.0" x="103.0" y="89.691" width="54.0" height="534.995" fill="red" opacity="0.2">
         <title stroke="black" stroke-width="1.0">BODYCOLUMN: 1/Arrays // In its most basic form, // all content is stored // in a very long array // of bits or bytes that is // subdivided in // various ways. // // // // // // // // // // // Namespace // All possible names for // wildcards and forms // build a namespace // that can be used for // storing anything, // irrespective of size. // // // // // // // // Namespace // All possible character // sequences for entries // of the ontology’s // dictionary define its // namespace. A // position in space is // occupied if a name // definition is // provided. // Conditional // definitions can // provide subspaces // for resolving // ambiguities. // // // // // // // // // // Sets // Sets can store elements // and subsets. Thus, // the identities of // existing sets, subsets, // and elements define // a nested storage // space. // // // // // // // // </title>
        </rect>
        <rect stroke="black" stroke-width="1.0" x="164.0" y="89.691" width="52.0" height="534.995" fill="red" opacity="0.2">
         <title stroke="black" stroke-width="1.0">BODYCOLUMN: 2/Array elements // The content of array // elements contains // the data that are // being processed. // Variable names can // be seen as more // readable names for // memory addresses. // // // // // // // // // Forms // All content is // represented as forms // that contain a // combination of // previously filled-in // content and // wildcards // // // // // // // Term definition // A term name is // equivalent to a // storage address, // where the content // matter behind the // name is given by its // definition. If context // dependent, this // houses multiple // definitions, as found // in dictionaries for // words used in // different contexts. // // // // // // // // // // // Elements // Elements can be either // basic or composite, // where the latter // define data in the // form of subsets. // // // // // // // // // // </title>
        </rect>
        <rect stroke="black" stroke-width="1.0" x="224.0" y="89.691" width="54.0" height="534.995" fill="red" opacity="0.2">
         <title stroke="black" stroke-width="1.0">BODYCOLUMN: 3/Code sequences // Some of the available // data are changed by // executing sequences // of commands in // scripts or functions. // // // // // // // // // // // // Fills // Forms are modified by // filling the places of // wildcards with // specified content. // This can create new // forms to fill. // // // // // // // // Cross links // A term defined by // other terms that are // defined by still other // terms creates a // network of links that // defines the code to be // executed. Cross links // easily create parallel // and/or recursive // structures that can // make it as difficult as // the halting problem // to know which // definitions are // circular (leading to // infinite loops). // // // // // // // // Query logic // Sequences of nested // queries that // successively narrow // down an original // broad set of // solutions until the // final answers are // isolated. // // // // // // // </title>
        </rect>
        <rect stroke="black" stroke-width="1.0" x="285.0" y="89.691" width="54.0" height="534.995" fill="red" opacity="0.2">
         <title stroke="black" stroke-width="1.0">BODYCOLUMN: 4/Starting pointer // Execution of all // computing starts by // following a pointer // to a well-defined // function or script, // which will point to // the next one, until // the task is completed // (or interrupted). // // // // // // // // Starting forms // Filling the initial forms // with initial content // triggers the rewriting // of all other forms in // specified order to // deliver the last // rewritten form as // output. // // // // // // Retrieving term // definitions // Each explicit definition // computes a full // execution tree. The // levels of nesting // equivalent to // generalized // computing depend // on how many // definitions are // expanded or // contracted. Aiming // to compare similar // terms from // independent // ontologies of the // same area thus easily // defines data // structures too // complex to complete // comparisons. // // // Requirements // It is often faster to start // execution with the // ultimate // requirements and // proceed by // evaluating only those // needed to meet // these. Forward // execution often // computes unneeded // details. // // // // </title>
        </rect>
        <rect stroke="black" stroke-width="1.0" x="346.0" y="89.691" width="53.0" height="534.995" fill="red" opacity="0.2">
         <title stroke="black" stroke-width="1.0">BODYCOLUMN: 5/Array locations // Names are human // readable labels // pointing to a // fixed-size box // position with // content of interest in // storage space. Much // work goes into // storing content // exceeding fixed box // sizes. // // // // // // Abstract roles // Names identify // patterns in dynamic // content with widely // varying sizes. Thus, // costs of using static // names or retrieving // content may be // unpredictable. // // // // // // Definitions // Names are keys to // dictionaries and // ontologies. Naming // is complicated by the // large shared // name-spaces, often // with controlled term // lists to minimize // accidental // ambiguities. For // defined ambiguities, // all conditions for // resolving the // ambiguities are // given. // // // // // // // // // Query results // Names identify // combinations of sets // and elements // directly or indirectly // specified using some // logic formalism; // great for querying // sets, but not for // numerical // computing. // // // // // </title>
        </rect>
        <rect stroke="black" stroke-width="1.0" x="407.0" y="89.691" width="53.0" height="534.995" fill="red" opacity="0.2">
         <title stroke="black" stroke-width="1.0">BODYCOLUMN: 6/Pointer bugs // Variable names // pointing to the // wrong box usually // return the wrong // content. Function // names pointing to // the wrong address // lead to bugs or // security holes. If // content does not fit // the allocated box, // names become // misleading and the // underlying // assumptions of the // code are violated. // Replacing bugs // Consequences of too // many substitutions // executed on top of // each other can be // unintuitive. Bugs // occur when the // formal definitions // specify unintended // substitutions. // // // // // Ambiguity bugs // Naming errors cause // two major problems: // accidental ambiguity // in use (from typos or // sloppy use of terms // in other definitions, // resulting in dead // pointers) and a // mismatch between // the name and // definition used for a // given term (by // ignoring key C2B // interfaces in users). // Such naming errors // can result in dead or // misguided links, // contradictions, // unnecessary // ambiguity, and // circular definitions // that obscure // meaning. // Set content bugs // Poor name choices // make it difficult to // determine the // boundaries of sets // queried; errors occur // when elements are // included that should // be omitted and vice // versa. Poor naming // of infix operators // with perplexing // precedence rules can // further obscure the // content of a set. // </title>
        </rect>
       </g>
